        private async Task DeleteAward(QuizAwardDto quizAward)
        {
            //Ask for user confirmation then delete according
            if (!await JSRuntime.InvokeAsync<bool>("confirm", $"Are you sure you want to delete: '{quizAward.Id}'?"))
